rity=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">卫生间是家居生活中很重要的一个部分，卫生间瓷砖颜色的选择与搭配，关系到整个家居空间的整体效果和主人品位，需要每一个新家的主人认真对待。</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">那么，卫生间瓷砖颜色怎么选？</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第一点。一般来说，在</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2015-03-11/1825.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\">挑选卫生间瓷砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">时，地砖的颜色要比墙砖的颜色深邃一点。卫生间瓷砖的颜色搭配上，尤其需要遵循这一个原则。卫生间的墙砖作为洁具（如马桶、洗手台）的背景，对洁具起到衬托作用，颜色的明度和丰富度不宜喧宾夺主，建议是比洁具颜色的明度、彩度低，方能起到较好的衬托效果。</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第二点。卫生间面积通常较小，卫生间瓷砖颜色不宜选用深色或暖色系的墙砖。这主要是从空间视觉上考虑。深色系的墙砖在视觉效应上会缩小卫生间空间，使得卫生间越加阴暗；而暖色系的墙砖，在视觉上有拉近效应，同样起到缩小卫生间空间的反作用，让人压抑。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent: 21pt; text-align: center;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"366\\\\\" align=\\\\\"middle\\\\\" alt=\\\\\"卫生间瓷砖颜色怎么选,卫生间瓷砖颜色搭配技巧.jpg\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-26/72b92a70ddefd3a4ca5ff18d1a194113.jpg\\\\\" /></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent: 21pt; text-align: center;\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent: 21pt; text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第三点。卫生间瓷砖颜色搭配上，对于图案的选择，要避免颜色鲜彩夺目，图案繁复的瓷砖，应该选择含蓄淡雅，色彩柔和的瓷砖，方能起到衬托洁具和舒缓神经的作用。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">综上所述，卫生间瓷砖颜色怎么选可以总结为：墙砖颜色浅色或素色（如白色、米黄、蓝色都可以），图案简单；地砖颜色比墙砖稍深；而卫生间瓷砖颜色搭配技巧上，整体颜色要明亮而朴素大方，不宜复杂、喧宾夺主。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">卫生间墙砖颜色的选择问题上，大部分消费者偏爱选择哈德逊型号<font face=\\\\\"Times New Roman\\\\\">:HDCW28-1</font><font face=\\\\\"宋体\\\\\">的</font></span></span><span><a href=\\\\\"http://www.hudsonhome.cn/cpyfw/cpfl/cp/2014-09-19/542.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\">白色瓷砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">，这款瓷砖的白色仿石纹效果，纹理逼真，还原经典石材，简约现代的风格尤其适合卫生间瓷砖颜色搭配。哈德逊更是供有型号<font face=\\\\\"Times New Roman\\\\\">HDHP05</font><font face=\\\\\"宋体\\\\\">的&ldquo;优雅巴黎瓷片&rdquo;，和白色瓷砖搭配，让卫生间瓷砖的颜色搭配脱离单调。</font></span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">其实在卫生间瓷砖颜色搭配技巧上，有很多学问，就像穿衣打扮一样，颜色搭配得好，会让您更加出众。哈德逊小编另外总结一篇关于<a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2015-03-26/1900.html\\\\\"><u><span style=\\\\\"color: rgb(0, 0, 255);\\\\\">瓷砖颜色搭配</span></u></a>的文章，建议您一定要去看看。点击左侧蓝色文字就可以轻松收获最全瓷砖颜色搭配技巧了哦。</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-indent:21.0000pt; mso-char-indent-count:2.0000; text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">文章来源：哈德逊瓷砖编辑原创</span></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"margin-left:0.0000pt; text-indent:21.0000pt; mso-pagination:widow-orphan; text-align:left; \\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">转载请注明出处</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\">http://www.hudsonhome.cn</span><span class=\\\\\"15\\\\\" style=\\\\\"font-family: 宋体; color: rgb(102, 102, 102); letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\">&ensp;</span></span></a></span></p>\r\n<p>&nbsp;</p>');");
E_D("replace into `phome_ecms_news_data_1` values('1904','8','','1','0','0','0','','','','<p><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">随着生活水平的上升，住久了的旧房子越来越跟不上现代人的审美。人们留恋着那片土地，在不搬迁的基础上，很多人都在谋划或者正在进行旧房改造。无论是想打造哪种<a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-11-27/1397.html\\\\\"><u><span style=\\\\\"color: rgb(0, 0, 255);\\\\\">装修风格</span></u></a>，在旧房的架构改造上，都不可任性。这涉及到房屋的整体受力分析，如果随意改变房屋架构，使得受力不均，最终造成房屋倒塌，也不是没发生过的事。不过各位未来的新房主人不必过于担心，哈德逊小编将在此详述旧房装修改造时必备的家装知识，只要认真遵守，在旧房改造上是不会出太大问题的。</span></p>\r\n<p><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\\\\\"false\\\\\"  DefUnhideWhenUsed=\\\\\"true\\\\\"  DefSemiHidden=\\\\\"true\\\\\"  DefQFormat=\\\\\"false\\\\\"  DefPriority=\\\\\"99\\\\\"  LatentStyleCount=\\\\\"260\\\\\" >\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Normal\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 1\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 2\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 3\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 4\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"heading 7\\\\\" ></w:LsdException>\r\n<w:LsdExcepti