idden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 3 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Dark List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">第一点，旧房装修改造时，墙体中的钢筋是不能动的。钢筋就像是纸制灯笼里的负责撑起灯笼纸的竹条，如若随意更改，就会影响到整个灯笼的架构，或许暂时从外形上看不出来，可在经历风吹雨打后，隐性的问题就有可能显示出来，到时候灯笼烂了，房子的居住环境也是危险的。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">第二点，顶梁柱是不能更改位置的。每一根顶梁柱都在支撑天花板上起到无可替代的作用。随意更改位置会导致天花板的支撑力不均匀，就会造成天花板很容易掉落。尤其是卧室的顶梁柱，如若您不小心拆除了或者更改了位置，而没有经过有经验建筑师的勘探设计，就很有可能&ldquo;天塌下来当被盖&rdquo;了。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">第三点，阳台上的矮墙万万不能拆。这矮墙指的是阳台与房间之间的墙体，这个墙体起着挑起阳台的巨大作用，如果您不小心拆除了或者改变了这堵墙的位置，很可能会导致阳台下沉。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align: center;\\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\"><img width=\\\\\"550\\\\\" height=\\\\\"319\\\\\" align=\\\\\"middle\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-26/0331607ab28c32541894a8e3cf22d35a.jpg\\\\\" alt=\\\\\"旧房改造,家装知识,装修必备家装知识.jpg\\\\\" />&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align: center;\\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">第四点，镶嵌在混凝土里的门窗，不是万不得已，不要拆。一般而言，墙体也是天花板的承重物，把门框镶嵌在里面一方面保证了门框的结实牢靠，另一方面，也是为墙体找了一个受力点，所以选门框的时候，一点要选结实的。如若把这个门框拆除了，墙体只有来自天花板的压力，地面缺乏支撑力，就会造成严重的安全隐患。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">第五点，水电改造在主体结构拆改之后。道理不言自明，水电改造主要是水龙头的安装、水表的位置、抽油烟机的安装、插座的安装等等，就像建新房子一样，水电的安装也是放到后面的。</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">第六点，装修材料的选择。重中之重是为新家选择一批崭新靓丽的瓷砖。哈德逊瓷砖秉承国外先进生产技术，传承国外瓷砖质量检验标准，专注于高质、高档瓷砖的生产与营销。领先在业内引入<font face=\\\\\"Times New Roman\\\\\">O2O</font><font face=\\\\\"宋体\\\\\">模式，线下展厅与<a href=\\\\\"http://www.hudsonbuy.com\\\\\"><u><span style=\\\\\"color: rgb(0, 0, 255);\\\\\">线上商城</span></u></a>的结合最大程度的方便了海内外消费者。产品远销欧美、非洲、中东地区，在国外有忠诚的品牌拥护者，在国内是佛山瓷砖十大品牌之一。是您旧房改造、新家装修、工程装修等的最优之选。</font></span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; font-size:10.5000pt; mso-font-kerning:1.0000pt; \\\\\">&nbsp;</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\">&nbsp;</p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; letter-spacing:0.0000pt; font-weight:normal; text-transform:none; font-style:normal; font-size:10.5000pt; mso-font-kerning:0.0000pt; \\\\\">文章来源：哈德逊瓷砖编辑原创</span></p>\r\n<p class=\\\\\"MsoNormal\\\\\" style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\"><span style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; letter-spacing:0.0000pt; font-weight:normal; text-transform:none; font-style:normal; font-size:10.5000pt; mso-font-kerning:0.0000pt; \\\\\">转载请注明出处</span><span><a href=\\\\\"http://www.hudsonhome.cn/\\\\\"><span class=\\\\\"15\\\\\" style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; color:rgb(0,0,255); letter-spacing:0.0000pt; font-weight:normal; text-transform:none; text-decoration:underline; text-underline:single; font-style:normal; font-size:10.5000pt; \\\\\">http://www.hudsonhome.cn</span><span class=\\\\\"15\\\\\" style=\\\\\"mso-spacerun:\\\\''yes\\\\''; font-family:宋体; color:rgb(102,102,102); letter-spacing:0.0000pt; font-weight:normal; text-transform:none; text-decoration:underline; text-underline:single; font-style:normal; font-size:9.0000pt; \\\\\">&ensp;</span></a></span></p>\r\n<p>&nbsp;</p>');");
