\\\\\"  Name=\\\\\"Colorful Grid Accent 5\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Light Grid Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Shading 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Shading 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium List 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium List 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 1 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 2 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Medium Grid 3 Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Dark List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Shading Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful List Accent 6\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Colorful Grid Accent 6\\\\\" ></w:LsdException>\r\n</w:LatentStyles></xml><![endif]--><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">瓷砖铺贴是每个人在装修房间时都需要了解的，尤其是近年来人们越来越喜欢亲力亲为，人人化身</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2014-10-20/1016.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">装修设计</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">师。瓷砖铺贴是装修的基础，完美的瓷砖铺贴是家庭装修最重要的一步。那么，有哪些瓷砖铺贴注意事项？</span></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第一，从选好瓷砖开始。按照装修不同区域而针对性的选择瓷砖。卫生间瓷砖要选吸水防滑的色彩含蓄淡雅的；厨房瓷砖也要选吸水防滑的，色彩上可以更明亮，提高食欲；</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2015-03-19/1848.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">客厅瓷砖</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">要选耐磨低吸水率的等等。在购买瓷砖时，为了保证瓷砖的高质，很多人会选择购买知名品牌的产品，如佛山十大瓷砖品牌之一的哈德逊瓷砖，专注十年出口瓷砖，瓷砖质量符合国际标准，产品远销欧美、非洲、中东地区，即使在反倾销硝烟四起的</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/xwzx/qyxw/2015-03-21/1851.html\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); text-decoration: underline;\\\\\" class=\\\\\"15\\\\\">瓷砖行业</span></span></a></span><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">环境下，<font face=\\\\\"Times New Roman\\\\\">2014</font><font face=\\\\\"宋体\\\\\">年的销售额也达到了亿量级别，是佛山瓷砖界的最强黑马。</font></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第二，选购好瓷砖后，在开始铺贴瓷砖之前，不要忘了&ldquo;地面找平&rdquo;。很多人以为地面找平只是在铺木地板的时候才需要，但其实在瓷砖铺贴时也是一个很重要的前期工作。所谓地面找平，要先检测地面的平整程度，一般方法是找一根长约<font face=\\\\\"Times New Roman\\\\\">2m</font><font face=\\\\\"宋体\\\\\">的靠尺，用靠尺在同一地面进行交叉位置的测量，看靠尺与地面间是否有空隙，如果有了</font><font face=\\\\\"Times New Roman\\\\\">3mm</font><font face=\\\\\"宋体\\\\\">以上的空隙，着地面就是不平整的，需要找平。地面找平是至关重要的一步，做好了会对以后瓷砖铺贴省下不少麻烦。</font></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第三，地面找平之后，在瓷砖铺贴前，应该先将瓷砖在水中浸泡<font face=\\\\\"Times New Roman\\\\\">30min</font><font face=\\\\\"宋体\\\\\">以上。因为瓷砖都会有一定程度的吸水，如果不浸泡够</font><font face=\\\\\"Times New Roman\\\\\">30min</font><font face=\\\\\"宋体\\\\\">，瓷砖铺贴之后会吸收水泥浆中的水分，容易造成瓷砖松脱，这样瓷砖铺贴就不持久了。而且，一些吸水率低的瓷砖，应该适当的延长浸泡时间。瓷砖铺贴前应阴干。</font></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align: center;\\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;<img width=\\\\\"550\\\\\" height=\\\\\"387\\\\\" align=\\\\\"middle\\\\\" src=\\\\\"/d/file/xwzx/qyxw/2015-03-26/ae9c139edf5949f73466dd22b640012a.jpg\\\\\" alt=\\\\\"瓷砖铺贴,瓷砖铺贴技注意事项,瓷砖铺贴技巧.jpg\\\\\" /></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第四，前期工作都准备好之后，可以开始铺贴瓷砖了。为了让瓷砖铺贴线条平整，在铺贴前要在地面上划&ldquo;十&rdquo;字形基准线，同时，如果边缘处地砖需要切割，要保证其面积至少是切割前地砖面积的一半以上，这是为了减少铺贴地砖面积突然减少的突兀感。</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">第五，瓷砖铺贴完之后，在<font face=\\\\\"Times New Roman\\\\\">24h</font><font face=\\\\\"宋体\\\\\">内必须洒水养护，完全干透后才能行走。</font></span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">最后提醒一点，卫生间和厨房在瓷砖铺贴时，应保持一定的倾斜度，以便于积水的流走。</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\">&nbsp;</p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">文章来源：哈德逊瓷砖编辑原创</span></span></p>\r\n<p style=\\\\\"text-align:justify; text-justify:inter-ideograph; \\\\\" class=\\\\\"MsoNormal\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; letter-spacing: 0pt; font-weight: normal; text-transform: none; font-style: normal;\\\\\">转载请注明出处</span></span><span><a href=\\\\\"http://www.hudsonhome.cn/\\\\\"><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体; color: rgb(0, 0, 255); letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\" class=\\\\\"15\\\\\">http://www.hudsonhome.cn</span><span style=\\\\\"font-family: 宋体; color: rgb(102, 102, 102); letter-spacing: 0pt; font-weight: normal; text-transform: none; text-decoration: underline; font-style: normal;\\\\\" class=\\\\\"15\\\\\">&ensp;</span></span></a></span></p>\r\n<p>&nbsp;</p>');");
E_D("replace into `phome_ecms_news_data_1` values('1905','51','1900','1','0','0','0','','','','<p><span style=\\\\\"font-size: 14px;\\\\\"><span style=\\\\\"font-family: 宋体;\\\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 装修颜色搭配一向是人们关心的话题，瓷砖色彩选择与搭配，关系到整个居室空间的整体效果和装饰品位。在装修颜色搭配上，再细心认真也不为过。今天哈德逊小编就来为大家奉献上《装修颜色搭配表》&nbsp;</span><span style=\\\\\"font-family: 宋体;\\\\\">：</span>&nbsp;</span></p>\r\n<p><span style=\\\\\"font-size: 14px;\\\\\">&nbsp;</span></p>\r\n<table width=\\\\\"600\\\\\" cellspacing=\\\\\"1\\\\\" cellpadding=\\\\\"1\\\\\" border=\\\\\"1\\\\\" align=\\\\\"center\\\\\">\r\n    <caption><span style=\\\\\"font-size: 14px;\\\\\"><strong>装修颜色搭配表</strong></span></caption>\r\n    <tbody>\r\n        <tr>\r\n            <td>\r\n            <p style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">米黄</span></p>\r\n            </td>\r\n            <td>使居室有一种富丽堂皇的高贵与典雅</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">石纹色</span></td>\r\n            <td>古朴自然，显得厚重而富有内涵</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">土色和赤土</span></td>\r\n            <td>铺在客厅和餐厅地面，可让人体会到田园风格的愉悦和舒适</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">蓝色和绿色</span></td>\r\n            <td>很容易让人联想到天空的深邃辽阔和草原的自然风景</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">红色</span></td>\r\n            <td>使地面看上去很特别，有一种华丽的感觉</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">灰色</span></td>\r\n            <td>更具文化品位和大自然风光，可凝造粗犷不羁的感觉</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: left;\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">黑与白对比</span></td>\r\n            <td>可增加地面的层次的结构感</td>\r\n        </tr>\r\n        <tr>\r\n            <td colspan=\\\\\"2\\\\\"><span style=\\\\\"font-size: 14px;\\\\\">&nbsp;</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: center;\\\\\" colspan=\\\\\"2\\\\\">暖色调的墙面的地面可使居室产生一种温馨的氛围</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: center;\\\\\" colspan=\\\\\"2\\\\\">而冷色调的墙地面，则让人感受到一股来自海洋的清凉与凉爽</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: center;\\\\\" colspan=\\\\\"2\\\\\">素色，白色，灰色等浅色显得简约，适合采光较差的房间铺贴</td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\\\\\"text-align: center;\\\\\" colspan=\\\\\"2\\\\\">黑色，红色，黄色等深色则显得厚重，适合采光较好的房间铺贴</td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p><span style=\\\\\"font-size: 14px;\\\\\"><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery><w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery><w:DocumentKind>DocumentNotSpecified</w:DocumentKind><w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing><w:PunctuationKerning></w:PunctuationKerning><w:View>Normal</w:View><w:Compatibility><w:DontGrowAutofit /><w:BalanceSingleByteDoubleByteWidth /><w:DoNotExpandShiftReturn /><w:UseFELayout /></w:Compatibility><w:Zoom>0</w:Zoom></w:WordDocument></xml><![endif]--></span></p>\r\n<p><span style=\\\\\"font-size: 14px;\\\\\"><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\\\\\"false\\\\\"  DefUnhideWhenUsed=\\\\\"true\\\\\"  DefSemiHidden=\\\\\"true\\\\\"  DefQFormat=\\\\\"false\\\\\"  DefPriority=\\\\\"99\\\\\"  LatentStyleCount=\\\\\"260\\\\\" >\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\\"false\\\\\"  Name=\\\\\"Normal\\\\\" ></w:LsdException>\r\n<w:LsdException Locked=\\\\\"false\\\\\"  Priority=\\\\\"99\\\\\"  SemiHidden=\\\\